def final_position(n, commands):
    # Initialize the starting position of the snake
    x, y = 0, 0

    # Iterate through each command
    for command in commands:
        if command == "UP":
            x -= 1
        elif command == "RIGHT":
            y += 1
        elif command == "DOWN":
            x += 1
        elif command == "LEFT":
            y -= 1

        # Ensure the snake remains within the grid boundaries
        x = max(0, min(n-1, x))
        y = max(0, min(n-1, y))

    # Return the final position of the snake
    return x * n + y

def final_position(n, commands):
    row, col = 0, 0
    for command in commands:
        if command == "UP":
            row = max(0, row - 1)
        elif command == "RIGHT":
            col = min(n - 1, col + 1)
        elif command == "DOWN":
            row = min(n - 1, row + 1)
        elif command == "LEFT":
            col = max(0, col - 1)
    return row * n + col

